from typing import List
from itertools import pairwise
from collections import Counter

class Solution:
    def countCompleteSubstrings(self, word: str, k: int) -> int:
        i, n = 1, len(word)
        substrs = [0]
        for x, y in pairwise(word):
            if abs(ord(y)-ord(x)) > 2:
                substrs.append(i)
            i+=1
        substrs.append(n)
        # print(substrs)
        
        def findfreqfromsubstrs(word: str, k:int, k_dash: int, i:int, j: int):
            freq = Counter(word[i:i+k_dash])
            ans = 0
            for idx in range(i+k_dash, j+1):
                for val in freq.values():
                    if val not in [0, k]: break
                else:
                    ans += 1

                if idx < j:
                    freq[word[idx]] += 1
                    freq[word[idx-k_dash]] -= 1
            return ans
        
        ans = 0
        for i, j in pairwise(substrs):
            for k_dash in range(k, min(j-i, k*26)+1, k):
                ans += findfreqfromsubstrs(word, k, k_dash, i, j)

        return ans


